              backup_text =
                "# EMOJIPAINT MVU PRELUDE #\n\n\
                 type Emoji = String in \n\
                 type Row = Int in \n\
                 type Col = Int in \n\
                 type Grid = [[Emoji]] in\n\n\
                 type Model = (\n\
                 Grid,     # The 2D grid of emojis #\n\
                 Emoji,    # The currently selected emoji #\n\
                 [Emoji]   # The list of available emojis #\n\
                 ) in\n\n\
                 type Action =\n\
                 + SelectEmoji(Emoji)    # Set the currently selected emoji #\n\
                 + StampEmoji(Row, Col)  # Stamp the current emoji at the \
                 specified position #\n\
                 + ClearCell(Row, Col)   # Clear the emoji at the specified \
                 position #\n\
                 + ClearGrid             # Clear the entire grid #\n\
                 + FillRow(Row)           # Fill the specified row with the \
                 current emoji #\n\
                 in\n\n\
                 let model_init: Model = (\n\
                 [[\"\",\"\",\"\"],[\"\",\"\",\"\"],[\"\",\"\",\"\"]], # \
                 Initial 3x3 empty grid #\n\
                 \"\240\159\152\132\",                               # Initial \
                 selected emoji #\n\
                 [\"\240\159\152\132\", \"\240\159\152\133\", \
                 \"\240\159\152\134\", \"\240\159\152\137\", \
                 \"\240\159\152\138\"]        # Available emojis #\n\
                 ) in\n\n\
                 let updateGrid: (Grid, Row, Col, Emoji) -> Grid =\n\
                 fun grid, row, col, emoji ->\n\
                 List.mapi(\n\
                 fun i, r -> \n\
                 if i == row   \n\
                 then List.mapi(fun j, c -> if j == col then emoji else c, r)  \n\
                 else r, \n\
                 grid\n\
                 ) in\n\n\
                 let clearGrid: Grid -> Grid =\n\
                 fun grid -> List.map(fun row -> List.map(fun _ -> \"\", row), \
                 grid)  \n\
                 in\n\n\
                 let fillRowInGrid: (Grid, Row, Emoji) -> Grid =\n\
                 fun grid, rowToFill, emoji ->\n\
                 List.mapi(\n\
                 fun i, row -> \n\
                 if i == rowToFill  \n\
                 then List.map(fun _ -> emoji, row)  \n\
                 else row,\n\
                 grid  \n\
                 ) in\n\n\
                 # Update the EmojiPaint app model based on an action #\n\n\
                 let update: (Model, Action) -> Model =\n\
                 fun (grid, selectedEmoji, emojiList), action ->\n\
                 case action \n\
                 | SelectEmoji(emoji) =>\n\
                 (grid, emoji, emojiList)\n\
                 | StampEmoji(row, col) =>\n\
                 (updateGrid(grid, row, col, selectedEmoji), selectedEmoji, \
                 emojiList)\n\
                 | ClearCell(row, col) =>\n\
                 (updateGrid(grid, row, col, \"\"), selectedEmoji, emojiList)\n\
                 | ClearGrid =>\n\
                 (clearGrid(grid), selectedEmoji, emojiList)\n\
                 | FillRow(row) =>\n\
                 (fillRowInGrid(grid, row, selectedEmoji), selectedEmoji, \
                 emojiList)  \n\
                 end in\n\n\
                 # EMOJIPAINT MVU TESTS #\n\n\
                 test \n\
                 let (grid, _, _) = update(model_init, StampEmoji(0, 0)) in\n\
                 grid == \
                 [[\"\240\159\152\132\",\"\",\"\"],[\"\",\"\",\"\"],[\"\",\"\",\"\"]]  \n\
                 end;\n\n\
                 test\n\
                 let (grid, _, _) = update(model_init, FillRow(1)) in\n\
                 grid == \
                 [[\"\",\"\",\"\"],[\"\240\159\152\132\",\"\240\159\152\132\",\"\240\159\152\132\"],[\"\",\"\",\"\"]]  \n\
                 end;\n\n\
                 test\n\
                 let model = update(model_init, \
                 SelectEmoji(\"\240\159\152\133\")) in\n\
                 let (grid, selectedEmoji, _) = update(model, StampEmoji(2, \
                 2)) in\n\
                 grid == \
                 [[\"\",\"\",\"\"],[\"\",\"\",\"\"],[\"\",\"\",\"\240\159\152\133\"]] \
                 && selectedEmoji == \"\240\159\152\133\"  \n\
                 end;\n\n\
                 test\n\
                 let model = update(model_init, FillRow(0)) in\n\
                 let (grid, _, _) = update(model, ClearCell(0, 1)) in\n\
                 grid == \
                 [[\"\240\159\152\132\",\"\",\"\240\159\152\132\"],[\"\",\"\",\"\"],[\"\",\"\",\"\"]]  \n\
                 end;\n\n\
                 test\n\
                 let model = update(model_init, StampEmoji(1, 1)) in\n\
                 let (grid, _, _) = update(model, ClearGrid) in\n\
                 grid == [[\"\",\"\",\"\"],[\"\",\"\",\"\"],[\"\",\"\",\"\"]]  \n\
                 end;\n\n\
                 test\n\
                 let (_, selectedEmoji, _) = update(model_init, \
                 SelectEmoji(\"\240\159\152\138\")) in\n\
                 let (grid_init, _, emojiList_init) = model_init in\n\
                 let (grid, _, _) = update((grid_init, selectedEmoji, \
                 emojiList_init), StampEmoji(1, 2)) in\n\
                 grid == \
                 [[\"\",\"\",\"\"],[\"\",\"\",\"\240\159\152\138\"],[\"\",\"\",\"\"]]  \n\
                 end;\n\n\
                 test\n\
                 let (_, selectedEmoji, emojiList) = model_init in\n\
                 let model = update(model_init, FillRow(2)) in\n\
                 let (grid, _, _) = update(model, ClearCell(2, 0)) in\n\
                 grid == \
                 [[\"\",\"\",\"\"],[\"\",\"\",\"\"],[\"\",\"\240\159\152\132\",\"\240\159\152\132\"]]  \n\
                 end;\n\n\
                 test\n\
                 let model = update(model_init, StampEmoji(0, 0)) in\n\
                 let model = update(model, StampEmoji(1, 1)) in\n\
                 let model = update(model, StampEmoji(2, 2)) in\n\
                 let (grid, _, _) = update(model, ClearGrid) in\n\
