                 let (grid, _, _) = update((grid, selectedEmoji, \
                 emojiList_init), StampEmoji(1, 1)) in\n\
                 grid == \
                 [[\"\240\159\152\132\",\"\240\159\152\132\",\"\240\159\152\132\"],[\"\",\"\240\159\152\134\",\"\"],[\"\",\"\",\"\"]]  \n\
                 end;\n\n\
                 test\n\
                 let model = update(model_init, StampEmoji(0, 0)) in\n\
                 let model = update(model, FillRow(2)) in\n\
                 let (grid, _, emojiList) = model in\n\
