              backup_text =
                "# PLAYLIST MVU PRELUDE #\n\n\
                 # Non-negative ID for songs #\n\
                 type Id = Int in\n\n\
                 # Actions user can do in a playlist #\n\
                 type PlayListAction =\n\
                 + PlaySong(Id)\n\
                 + PauseCurrentSong\n\
                 + RemoveSong(Id)\n\
                 # Add to the front of the playList, ignore duplication #\n\
                 + AddSong(Id) \n\
                 in\n\n\
                 # The state of the playlist #\n\
                 type PlayListState =\n\
                 + Playing(Id)\n\
                 + PausedOn(Id)\n\
                 + NoSongSelected \n\
                 in\n\n\
                 # A playlist with a list of songs and the current state of \
                 the playlist #\n\
                 type PlayList = ([Id], PlayListState) in\n\n\
                 # Get all the song ids in the playlist #\n\
                 let get_songs: PlayList -> [Id] =\n\
                 fun playlist ->\n\
                 let songs, current = playlist in\n\
                 songs  \n\
                 in\n\n\
                 # Get the id of the currently playing song #\n\
                 let get_state: PlayList -> PlayListState =\n\
                 fun playlist ->\n\
                 let songs, state = playlist in\n\
                 state \n\
                 in\n\n\
                 # Update Playlist app model based on an action #\n\n\
                 let update: (PlayList, PlayListAction) -> PlayList =\n\
                 fun playlist, action ->\n\
                 case action\n\
                 | PlaySong(id) => (get_songs(playlist), Playing(id))\n\
                 | PauseCurrentSong =>\n\
                 case get_state(playlist)\n\
                 | Playing(id) =>\n\
                 (get_songs(playlist), PausedOn(id))\n\
                 | state =>\n\
                 (get_songs(playlist), state) \n\
                 end\n\
                 | RemoveSong(id) =>\n\
                 let new_songs = \n\
                 List.filter((fun x -> x!= id), get_songs(playlist)) \n\
                 in\n\
                 let new_state =\n\
                 case get_state(playlist)\n\
                 | Playing(current_id) =>\n\
                 if id == current_id then\n\
                 NoSongSelected \n\
                 else\n\
                 Playing(current_id)\n\
                 | PausedOn(current_id) =>\n\
                 if id == current_id then\n\
                 NoSongSelected \n\
                 else\n\
                 PausedOn(current_id)\n\
                 | NoSongSelected =>\n\
                 NoSongSelected \n\
                 end \n\
                 in\n\
                 (new_songs, new_state)\n\
                 | AddSong(id) => (id::get_songs(playlist), \
                 get_state(playlist)) \n\
                 end \n\
                 in\n\n\
                 # PLAYLIST MVU TESTS #\n\n\
                 let PlayListState.eq: (PlayListState, PlayListState) -> Bool =\n\
                 fun s1, s2 ->\n\
                 case s1, s2\n\
                 | Playing(i1), Playing(i2) => i1 == i2\n\
                 | PausedOn(i1), PausedOn(i2) => i1 == i2\n\
                 | NoSongSelected, NoSongSelected => true\n\
                 | _ => false \n\
                 end \n\
                 in\n\n\
                 let PlayList.eq: (PlayList, PlayList) -> Bool =\n\
                 fun p1, p2 ->\n\
                 PlayListState.eq(get_state(p1), get_state(p2)) &&\n\
                 List.eq(fun i1, i2 -> i1 == i2, get_songs(p1), get_songs(p2)) \n\
                 in\n\n\
                 # Testing PlaySong #\n\
                 test PlayList.eq(update(([0, 1, 2], NoSongSelected), \
                 PlaySong(0)), ([0, 1, 2], Playing(0))) end;\n\
                 test PlayList.eq(update(([0, 1, 2], PausedOn(1)), \
                 PlaySong(1)), ([0, 1, 2], Playing(1))) end;\n\
                 test PlayList.eq(update(([0, 1, 2], PausedOn(0)), \
                 PlaySong(1)), ([0, 1, 2], Playing(1))) end;\n\n\
                 # Testing PauseCurrentSong #\n\
                 test PlayList.eq(update(([0, 1, 2], NoSongSelected), \
                 PauseCurrentSong) ,([0, 1, 2], NoSongSelected)) end;\n\
                 test PlayList.eq(update(([0, 1, 2], PausedOn(1)), \
                 PauseCurrentSong), ([0, 1, 2], PausedOn(1))) end;\n\
                 test PlayList.eq(update(([0, 1, 2], Playing(0)), \
                 PauseCurrentSong), ([0, 1, 2], PausedOn(0))) end;\n\n\
                 # Testing RemoveSong #\n\
                 test PlayList.eq(update(([0, 1, 2], NoSongSelected), \
                 RemoveSong(0)), ([1, 2], NoSongSelected)) end;\n\
                 test PlayList.eq(update(([0, 1, 2], Playing(0)), \
                 RemoveSong(0)), ([1, 2], NoSongSelected)) end;\n\
                 test PlayList.eq(update(([0, 1, 2], PausedOn(0)), \
                 RemoveSong(0)), ([1, 2], NoSongSelected)) end;\n\
                 test PlayList.eq(update(([0, 1, 2], Playing(1)), \
                 RemoveSong(0)), ([1, 2], Playing(1))) end;\n\
                 test PlayList.eq(update(([0, 1, 2], PausedOn(1)), \
                 RemoveSong(0)), ([1, 2], PausedOn(1))) end;\n\
                 test PlayList.eq(update(([0, 1, 2], Playing(1)), \
                 RemoveSong(3)), ([0, 1, 2], Playing(1))) end;\n\n\
                 # Testing AddSong #\n\
                 test PlayList.eq(update(([0, 1, 2], NoSongSelected), \
                 AddSong(3)), ([3, 0, 1, 2], NoSongSelected)) end;\n\
                 test PlayList.eq(update(([0, 1, 2], Playing(0)), AddSong(3)), \
                 ([3, 0, 1, 2], Playing(0))) end;\n\
                 test PlayList.eq(update(([0, 1, 2], PausedOn(0)), \
